import React from "react";
import Wrapper from "../Wrapper/";
import Thumbnail from "../Thumbnail";
import thumbnail from "../../Assets/coming-soon.jpeg";

function Portfolio() {
  const projects = [
    {
      name: "Project 1",
      thumbnail: "./Assets/coming-soon.jpeg",
      url: "https://github.com/kennyqng"
    },
    {
      name: "Project 2",
      thumbnail: "./Assets/coming-soon.jpeg",
      url: "https://github.com/kennyqng/"
    },
    {
      name: "Project 3",
      thumbnail: "./Assets/coming-soon.jpeg",
      url: "https://github.com/kennyqng/"
    }
  ]
  return (
    <Wrapper>
      {projects.map(
        <Thumbnail
          url={projects.project}
          image={projects.project}
          name={projects.project}
        />
      )}
    </Wrapper>
  );
}

export default Portfolio;
